import React, { useState } from 'react';
import { Box, Button, Typography, TextField, Grid } from '@mui/material';
import NameScroller from './components/NameScroller';
import './App.css';

const namesList = [
  "Waviloid Studio","Mahay Tsy Resy Mahavonjy","Anais Kacey","Sera Rehetra","Andriah Mihaja","Maminiaina RH","Jūlį Ãnåh","Nèkènæ Tanjona","Ÿånn Ĩčk","Dauphin Rakotoarivelo","Razafivatobe Sergio","Andriantsoa Aro",
  "Louisianah Ornella","Malala Tiana","Kazy TMa","Tantely Rasamson Joe","Rah Tiavina","Christina Ayah Iriela","Alexander Wiliam","Estelah Mayah","Nou Raf","Mihajatiana Andrianantoanina","Jessïïcä Dzy","Jossette Oliva","Maurilla Vague",
  "Rose Mikanto","Diæ Ry","Murielah Rkt","Viaviny Antatsimo","Tsiky Kwelly","Rotsy Tsoa","Centy Tia","Odi Camarack","Lalatiana Ras","Eliha Sina","Mahazo Tsara Lidiah","Aissat Xennah Ramarovololona","Ranaivosoa Tatamo",
  "Mahaliana Fitia","Jahelah Rhn","Eliot Raphaël De Mada","Moznah Sidonie","Christina Mara","Nomenjanahary Fenitra","Loke Sha","Rabemanantsoa Chrystopher","Rj Màh Noo","Maholisoa Noellah","Razanamanaja Marie Daniellah",
  "Sakay Pilopilo","An Do","Mamisoa Fabienne","Ginah Navalona","Tsohaa Nomenjanahary","Koloina Naly","Estelle Olivier Richella","Ny Volatiana","Dinah Sy Sandy","Antoinette Mihaminarivo","Karënë Sįsï","Kimmerlouise Razafindrina","Fanyah Jeysse"
];

const fixedWinners = [
  "Razafivatobe Sergio",
  "Rabemanantsoa Chrystopher",
  "Anais Kacey"
];

function App() {
  const [winners, setWinners] = useState(["", "", ""]);
  const [drawIndex, setDrawIndex] = useState(0);
  const [scrolling, setScrolling] = useState(false);
  const [selectedName, setSelectedName] = useState("");

  const handleDraw = () => {
    if (drawIndex < 3 && !scrolling) {
      setScrolling(true);
      let count = 0;
      const interval = setInterval(() => {
        const randomName = namesList[Math.floor(Math.random() * namesList.length)];
        setSelectedName(randomName);
        count++;
        if (count >= 50) {
          clearInterval(interval);
          const finalName = fixedWinners[drawIndex];
          setSelectedName(finalName);
          const updatedWinners = [...winners];
          updatedWinners[drawIndex] = finalName;
          setWinners(updatedWinners);
          setDrawIndex(drawIndex + 1);
          setScrolling(false);
        }
      }, 100);
    }
  };

  const handleReset = () => {
    setWinners(["", "", ""]);
    setDrawIndex(0);
    setSelectedName("");
    setScrolling(false);
  };

  return (
      <Box p={4} display="flex" flexDirection="column" alignItems="center">
        <img src="/happy.png" alt="happy banner" width="700" height="192" />

        <Grid container spacing={4} mt={4} justifyContent="center">
          <Grid item xs={12} md={6}>
            <NameScroller selectedName={selectedName} />
          </Grid>

          <Grid item xs={12} md={6}>
            <Typography variant="h5" gutterBottom>Résultats</Typography>
            {winners.map((name, i) => (
                <Box key={i} display="flex" alignItems="center" mb={2}>
                  <TextField
                      label={`N°${i + 1}`}
                      value={name}
                      fullWidth
                      InputProps={{ readOnly: true }}
                  />
                  <Typography ml={2}>
                    {i === 0
                        ? "a gagné(e) la somme de 100 EURO"
                        : "a gagné(e) cadeau surprise crédit 1000 AR"}
                  </Typography>
                </Box>
            ))}
          </Grid>
        </Grid>

        <Box mt={4} display="flex" gap={2}>
          <Button
              variant="contained"
              color="primary"
              size="large"
              onClick={handleDraw}
              disabled={scrolling || drawIndex >= 3}
              sx={{ borderRadius: '20px', px: 4 }}
          >
            Lancer le tirage
          </Button>
          <Button
              variant="outlined"
              color="secondary"
              size="large"
              onClick={handleReset}
              sx={{ borderRadius: '20px', px: 4 }}
          >
            Reset
          </Button>
        </Box>
      </Box>
  );
}

export default App;
